import React from 'react';
const card = [
    { 'title': 'نمایشگاه' },
    { 'title': 'نمایشگاه' },
    { 'title': 'نمایشگاه' },
    { 'title': 'نمایشگاه' },
];

export default function index() {
    return (
        <div className="relative px-36">
            <div className=" mt-32 flex justify-center">
                {card.map((item) => (
                    <div className="bg-green-500 w-48 h-24 rounded-2xl flex justify-center items-center">
                        <p>{item.title}</p>
                    </div>
                ))}
            </div>
        </div>
    );
}
